import React from 'react';

export const About = () => (
	<div>
		<h2>About Page</h2>
		<p>Once you learn the technique, ohhh! Turn you loose on the world; you become a tiger. If you've been in Alaska less than a year you're a Cheechako. All you have to learn here is how to have fun. All you need to paint is a few tools, a little instruction, and a vision in your mind. If it's not what you want - stop and change it. Don't just keep going and expect it will get better. No worries. No cares. Just float and wait for the wind to blow you around.</p>
		<p>Work on one thing at a time. Don't get carried away - we have plenty of time. You have to make almighty decisions when you're the creator. We start with a vision in our heart, and we put it on canvas. That's why I paint - because I can create the kind of world I want - and I can make this world as happy as I want it. Look around, look at what we have. Beauty is everywhere, you only have to look to see it.</p>
		<p>Don't be afraid to make these big decisions. Once you start, they sort of just make themselves. If what you're doing doesn't make you happy - you're doing the wrong thing. This is the time to get out all your flustrations, much better than kicking the dog around the house or taking it out on your spouse. Mix your color marbly don't mix it dead. All you need is a dream in your heart, and an almighty knife.</p>
	</div>
	)
